
function zakazi(){
    var firstName = document.formaNutricionista.firstName.value;
    var lastName = document.formaNutricionista.lastName.value;
    var email = document.formaNutricionista.email.value;
    var phone = document.formaNutricionista.phone.value;
    var date = document.formaNutricionista.date.value; 
    var date_dd = date.split('-')[2];
    var date_mm = date.split('-')[1];
    var date_yyyy = date.split('-')[0];
    var problemDesc = document.formaNutricionista.problemDesc.value;

    var error = false;

    //proveriti ime-min 2 slova
    var rx = /.{2,}/;
    if(!rx.test(firstName)){
        document.getElementById("nameError").innerHTML = "<br/>Name must contain at least 2 characters.";
        error = true;
    }else{
        document.getElementById("nameError").innerHTML = "";
    }

    //proveriti prezime-min 2 slova
    if(!rx.test(lastName)){
        document.getElementById("lastnameError").innerHTML = "<br/> Surame must contain at least 2 characters.";
        error = true;
    }else{
        document.getElementById("lastnameError").innerHTML = "";
    }

    //proveriti mejl - format ___@___.__
    var mailRegExp = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
    if(!mailRegExp.test(email)){
        document.getElementById("emailError").innerHTML = "<br/> E-mail is not in valid format.";
        error = true;
    }else{
        document.getElementById("emailError").innerHTML = "";
    }

    //proveri telefon
    var mobileRegExp = /^(\d{10}|\d{3}-\d{3}-\d{4}|\(\d{3}\)\d{3}-\d{4})$/;
    if(phone == ""){
        document.getElementById("phoneError").innerHTML = "<br/> Please enter your contact number.";
    }else if(!mobileRegExp.test(phone)){
        document.getElementById("phoneError").innerHTML = "<br/> Your contact number is not in valid format.";
        error = true;
    }else{
        document.getElementById("phoneError").innerHTML = "";
    }

    //proveriti datum, min danasnji
    var todaysDate = new Date(); 
    var dd = String(todaysDate.getDate()).padStart(2, '0');
    var mm = String(todaysDate.getMonth() + 1).padStart(2, '0'); //January is 0!
    var yyyy = todaysDate.getFullYear();
    if(date == ""){
        document.getElementById("dateError").innerHTML = "<br/> You didn't select date.";
        error = true;
    }else if(date_yyyy < yyyy){
        document.getElementById("dateError").innerHTML = "<br/>  Date can't be in past.";
        error = true;
    }else if((date_mm < mm) && (date_yyyy == yyyy)){
        document.getElementById("dateError").innerHTML = "<br/>  Date can't be in past.";
        error = true;
    }else if((date_yyyy == yyyy) && (date_mm == mm) && (date_dd < dd)){
        document.getElementById("dateError").innerHTML = "<br/>  Date can't be in past.";
        error = true;
    }else{
        document.getElementById("dateError").innerHTML = "";
    }
    

    //proveriti problem-da nije prazno
    if(problemDesc==""){
        document.getElementById("problemDescError").innerHTML = "<br/> Field can't be empty.";
        error = true;
    }else{
        document.getElementById("problemDescError").innerHTML = "";
    }

    //zapamti formu
    if(error){
        return;
    }else{
        Swal.queue([{
            icon: 'success',
            title: 'See you soon!',
            text: 'You have successfully booked a nutritionist appointment. Do you want to download PDF of your booking?',
            confirmButtonColor: 'green',
            confirmButtonText: 'Yes, download PDF',
            showLoaderOnConfirm: true,
            preConfirm: () => {
                kreirajPDF();
                Swal.insertQueueStep({
                    icon: 'success',
                    title: 'Download successfull.'
                })
            },

            showCancelButton: true,
            cancelButtonColor: 'red',
            cancelButtonText: "No",
            
        }])
    }
        
}

function kreirajPDF(){
    var doc = new jsPDF();
    var firstName = document.formaNutricionista.firstName.value;
    var lastName = document.formaNutricionista.lastName.value;
    var email = document.formaNutricionista.email.value;
    var phone = document.formaNutricionista.phone.value;
    var date = document.formaNutricionista.date.value; 
    var date_dd = date.split('-')[2];
    var date_mm = date.split('-')[1];
    var date_yyyy = date.split('-')[0];
    var problemDesc = document.formaNutricionista.problemDesc.value;

    var imgData = "data:image/jpeg;base64,";
    var text =
      "Name and surname: " +
      firstName + " " + lastName +
      "\n\nE-mail: " +
      email +
      "\n\nContact number: " +
      phone +
      "\n\nDate: " +
      date_dd + "/" + date_mm + "/" + date_yyyy +
      "\n\nDescription: " +
      problemDesc;
    
    doc.addImage(imgData, 'JPEG',0,0,210,297);
    doc.text(10,80,text);
    doc.save("Inferno_gym_nutritionist.pdf");
}